import style from './index.module.css'
import { useAppSelector as useSel } from '@/store/index'
import type { CSSProperties, ReactNode } from 'react'

export type Props = {
  children: ReactNode

  variant?: 'defaultVariant'
  difference?: string
  style?: CSSProperties
}

export function $Component$({
  children,

  variant = 'defaultVariant',
  difference,
  style: inlineStyle,
}: Props): JSX.Element {
  return (
    <div 
      className={[style.button, style[variant], difference ?? style.defaultDifference].join(
        ' ',
      )}
      style={inlineStyle}
    >
      {children}
    </div>
  )
}

